	public function index()
	{
		if (($this->session->userdata['status']=='login') & ($this->session->userdata['sts']==1)) {
		    $params['limit'] = RECORDS_PER_PAGE;    
		    $params['offset'] = ($this->input->get('per_page')) ? $this->input->get('per_page') : 0;
		    $config = $this->config->item('pagination');
		    $config['base_url'] = site_url('permohonan/index?');
		    $config['total_rows'] = $this->M_permohonan->get_all_permohonan_count();
		    $this->pagination->initialize($config);
		    $data['permohonan'] = $this->M_permohonan->get_all_permohonan($params);        
		    $data['_view'] = 'v_permohonan/index';
		    $data['level'] = $this->session->userdata('level')??'Pegawai';
		    $data['_landing'] = false;
		    $data['judul'] = "Data permohonan";
		    $load = $this->loader->load($data);
		    $this->load->view('layouts/content',$load);
		} else {
		    redirect('login');
		}			
	}


	private function kodeotomatis(){

            $res = $this->db->query('select max(right(psl_no,7)) as `urut_tgl`,max(substring(psl_no,3,3)) as `urut` from tb_psl')->row();
            $tgl = date('/m.Y');
            if (isset($res->urut)) {
                $urut = intval($res->urut);
                $bln = substr($res->urut_tgl, 0,2);
                $thn = substr($res->urut_tgl, 3,4);
                if (substr($tgl, 1,2)==$bln) { ## bulan
                    if (substr($tgl, 4,4)==$thn) { ## tahun
                        if ($urut >= 999) {
                            $urut+=0;
                        }else{
                            $urut++;
                        }
                    }else{
                        $urut=1;
                    }
                }else{
                    $urut=1;
                }
            }else{
                $urut=1;
            }
            $str_length = strlen($urut);
            $dig = substr("000{$urut}", $str_length);
            // return 'P-'.$dig.'/BSI'.$tgl;
            return 'P-'.$dig.$tgl;
    }

    function rules(){
        $this->form_validation->set_message('max_length', '{field} tidk dapat lebih dari {param} karakter.');
        $this->form_validation->set_message('required', 'Memerlukan {field}.');
        $this->form_validation->set_message('is_unique', '{field} telah digunakan.');
    }

    public function cek_psl($no){
    	$cek = intval(substr($no, 2,3));

    	if($cek==999)
    	{
    	   $this->form_validation->set_message('cek_psl', 'Data telah mencapat batas pada bulan ini');
    	   return FALSE;
    	} 
    	return TRUE;
    }


    public function cek_direktur($cek_direktur){
    	$cek = $this->M_direktur->get_direktur_by_no($cek_direktur);
    	if  (isset($cek['direktur_id'])) {
    		return true;
    	}else{
    		return false;
    	}
    }

